function lcs(X, Y, subsequence) {
  let m = X.length,
    n = Y.length;

  let L = new Array(2);
  for (let i = 0; i < 2; i++) {
    L[i] = new Array(n + 1);
    for (let j = 0; j < n + 1; j++) {
      L[i][j] = 0;
    }
  }
  let bi = 0;

  for (let i = 0; i <= m; i++) {
    bi = i & 1;

    for (let j = 0; j <= n; j++) {
      if (i == 0 || j == 0) L[bi][j] = 0;
      else if (X[i - 1] == Y[j - 1]) {
        L[bi][j] = L[1 - bi][j - 1] + 1;
        subsequence += Y[j - 1];
      } else L[bi][j] = Math.max(L[1 - bi][j], L[bi][j - 1]);
    }
  }
  return L[bi][n];
}
